import TableRow from './TableRow/TableRow'
import './TableList.css'
const TableList = ({ tableList }) => (
    <div className="TableListWrapper">
        {tableList.map(user => (
            <TableRow key={user.id} user={user} />
    ))}
    </div>
)
export default TableList
